The Essential Bob Dylan is a compilation by Bob Dylan, released as a double-CD set in 2000, part of Columbia Records' &quot;The Essential&quot; series. The Essential Bob Dylan spans from 1963's &quot;Blowin' In The Wind&quot; (taken from The Freewheelin' Bob Dylan) to 1999's &quot;Things Have Changed&quot; (Dylan's Oscar-winning song from the motion picture, Wonder Boys).

